'use strict';

exports.getEvents = function(args, res, next) {
  /**
   * retrieve events by timestamp (long)
   * Events are used to track stack creation initiated by cloudbreak users. Events are generated by the backend when resources requested by the user become available or unavailable
   *
   * since Long  (optional)
   * returns List
   **/
  var examples = {};
  examples['application/json'] = [ {
  "eventMessage" : "aeiou",
  "owner" : "aeiou",
  "blueprintName" : "aeiou",
  "stackId" : 5,
  "stackName" : "aeiou",
  "stackStatus" : "REQUESTED",
  "eventType" : "aeiou",
  "clusterId" : 1,
  "instanceGroup" : "aeiou",
  "availabilityZone" : "aeiou",
  "blueprintId" : 6,
  "cloud" : "aeiou",
  "clusterName" : "aeiou",
  "nodeCount" : 5,
  "region" : "aeiou",
  "account" : "aeiou",
  "clusterStatus" : "REQUESTED",
  "eventTimestamp" : 0
} ];
  if (Object.keys(examples).length > 0) {
    res.setHeader('Content-Type', 'application/json');
    res.end(JSON.stringify(examples[Object.keys(examples)[0]] || {}, null, 2));
  } else {
    res.end();
  }
}

